@EU_Commission "Fair" minimum wage. Says who? 
"Climate pact", i.e. demanding 100 billion euros spent by national governments for unknown policies.
"Pay transparency" says woman who increased her own salary by €550 to €28,461 (£24,100) a MONTH on first day as President of European Commission.

@EU_Commission @vonderleyen @RegSprecher @govgr 
Dear European &amp; National leaders,
is the #EU doing anything to help the Australian government? The situation is quite serious &amp; devastating.

